<p>
<p>–ö—Ä–æ–º–µ —Å—Ç–∞—Ü–∏–æ–Ω–∞—Ä–Ω—ã—Ö –∑–∞–≤–µ–¥–µ–Ω–∏–π –ø–∏—Ç–∞–Ω–∏—è, –≤ –ª–µ—Ç–Ω–µ–µ –≤—Ä–µ–º—è –≤–¥–æ–ª—å –Ω–∞–±–µ—Ä–µ–∂–Ω–æ–π —Ä–∞–±–æ—Ç–∞–µ—Ç –±–æ–ª—å—à–æ–µ –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —Ç–æ—á–µ–∫ —É–ª–∏—á–Ω–æ–≥–æ —Ñ–∞—Å—Ç-—Ñ—É–¥–∞, –ø—Ä–µ–¥–ª–∞–≥–∞—é—â–µ–≥–æ —à–∞—à–ª—ã–∫, –≤—ã–ø–µ—á–∫—É, —á–µ–±—É—Ä–µ–∫–∏, –≤–∞—Ä–µ–Ω—É—é –∫—É–∫—É—Ä—É–∑—É –∏ —Ç–æ–º—É –ø–æ–¥–æ–±–Ω–æ–µ. –ù–∞ –ø–ª—è–∂–∞—Ö, –∫–∞–∫ –∏ –≤ –ö–∏—Ä–∏–ª–ª–æ–≤–∫–µ, –∫—É—Ä—Å–∏—Ä—É—é—Ç –∫–æ—Ä–æ–±–µ–π–Ω–∏–∫–∏ —Å –≥–æ—Ç–æ–≤—ã–º–∏ –æ–±–µ–¥–∞–º–∏, –ø–∏—Ä–æ–∂–∫–∞–º–∏, –∫—Ä–µ–≤–µ—Ç–∫–∞–º–∏, –ø–∞—Ö–ª–∞–≤–æ–π –∏ –ø—Ä–æ—á–∏–º–∏ —è—Å—Ç–≤–∞–º–∏ –Ω–µ–ø—Ä–æ–≤–µ—Ä–µ–Ω–Ω–æ–≥–æ –∫–∞—á–µ—Å—Ç–≤–∞ –∏ –Ω–µ–æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω–æ–π –¥–∞—Ç—ã –∏–∑–≥–æ—Ç–æ–≤–ª–µ–Ω–∏—è. –í —Ü–µ–ª–æ–º, –Ω–∞ –∫—É—Ä–æ—Ä—Ç–µ —Å–ª–æ–∂–Ω–æ—Å—Ç–µ–π —Å –º–æ–±–∏–ª—å–Ω–æ–π —Å–≤—è–∑—å—é –∏ –∏–Ω—Ç–µ—Ä–Ω–µ—Ç–æ–º –Ω–µ—Ç. –û—Å–Ω–æ–≤–Ω—ã–º–∏ –ø–æ—Å—Ç–∞–≤—â–∏–∫–∞–º–∏ –∏–Ω—Ç–µ—Ä–Ω–µ—Ç-—Å–≤—è–∑–∏ –≤ —Ä–∞–º–∫–∞—Ö –∫—É—Ä–æ—Ä—Ç–∞ —è–≤–ª—è—é—Ç—Å—è –∫–æ–º–ø–∞–Ω–∏–∏ –£–∫—Ä—Ç–µ–ª–µ–∫–æ–º, –ö–∞—Ö–æ–≤–∫–∞.</p>
<p>–ù–µ—Ç, –ò–Ω—Ç–µ—Ä—Ç–µ–ª–µ–∫–æ–º, –¢—Ä–∏–ú–æ–± –∏ lifecell. –°–æ–≥–ª–∞—Å–Ω–æ –¥–∞–Ω–Ω—ã–º —Å–∞–π—Ç–∞ ru. –í—Å–µ —Å–Ω–∏–º–∫–∏ –°–∫–∞–¥–æ–≤—Å–∫–∞ –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—Ç –ø—Ä–æ–µ–∫—Ç—É ¬´–ö–∏—Ä–∏–ª–ª–æ–≤–∫–∞. –ö–æ–ø–∏—Ä–æ–≤–∞–Ω–∏–µ –Ω–∞ –¥—Ä—É–≥–∏–µ —Å–∞–π—Ç—ã –±–µ–∑ —Ä–∞–∑—Ä–µ—à–µ–Ω–∏—è —Ä–µ–¥–∞–∫—Ü–∏–∏ –∑–∞–ø—Ä–µ—â–µ–Ω–æ –∏ –ø—Ä–∏–≤–µ–¥–µ—Ç –∫ –ø–æ–¥–∞—á–µ DMCA-–∏—Å–∫–∞. –ù–µ—Ä–µ–≥—É–ª—è—Ä–Ω—ã–µ –ø–µ—Ä–µ–≤–æ–∑–∫–∏ –ø–∞—Å—Å–∞–∂–∏—Ä–æ–≤ –≤ –ª–µ—Ç–Ω–µ–µ –≤—Ä–µ–º—è –æ—Ä–≥–∞–Ω–∏–∑–æ–≤—ã–≤–∞—é—Ç —Ç—Ä–∞–Ω—Å–ø–æ—Ä—Ç–Ω—ã–µ –∫–æ–º–ø–∞–Ω–∏–∏, –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –∫–æ—Ç–æ—Ä—ã—Ö –º–æ–∂–Ω–æ —É–≤–∏–¥–µ—Ç—å –≤ –∏–Ω—Ç–µ—Ä–Ω–µ—Ç–µ, –≤ –≥–∞–∑–µ—Ç–∞—Ö –æ–±—ä—è–≤–ª–µ–Ω–∏–π, –Ω–∞ —Ä–µ–∫–ª–∞–º–Ω—ã—Ö –ª–∏—Å—Ç–∫–∞—Ö –≤ —Ç—Ä–∞–Ω—Å–ø–æ—Ä—Ç–µ. –ù–µ–∫–æ—Ç–æ—Ä—ã–µ –∏–∑ –Ω–∏—Ö –º–æ–≥—É—Ç –ø—Ä–µ–¥–ª–æ–∂–∏—Ç—å –ø–æ—Å–∞–¥–∫—É –∏ –≤—ã—Å–∞–¥–∫—É –ø–∞—Å—Å–∞–∂–∏—Ä–æ–≤ –ø–æ —Ä–∞–π–æ–Ω–∞–º –≥–æ—Ä–æ–¥–∞, –∫–æ–º—Ñ–æ—Ä—Ç–∞–±–µ–ª—å–Ω—ã–π –º–∏–∫—Ä–æ–∞–≤—Ç–æ–±—É—Å —Å –∫–æ–Ω–¥–∏—Ü–∏–æ–Ω–µ—Ä–æ–º –∏ —Ç–µ–ª–µ–≤–∏–∑–æ—Ä–æ–º, —É–¥–æ–±–Ω–æ–µ –≤—Ä–µ–º—è.</p>
<p>–ü—Ä–∏ —ç—Ç–æ–º —Ü–µ–Ω–∞ –Ω–∞ –±–∏–ª–µ—Ç –º–æ–∂–µ—Ç –±—ã—Ç—å –ø—Ä–∏–º–µ—Ä–Ω–æ —Ä–∞–≤–Ω–∞ —Å—Ç–æ–∏–º–æ—Å—Ç–∏ –∑–∞ –º–µ—Å—Ç–æ –≤ —Ä–µ–π—Å–æ–≤–æ–º –∞–≤—Ç–æ–±—É—Å–µ. –ñ–µ–ª–µ–∑–Ω–æ–¥–æ—Ä–æ–∂–Ω–æ–≥–æ —Å–æ–æ–±—â–µ–Ω–∏—è —Å–æ –°–∫–∞–¥–æ–≤—Å–∫–æ–º –Ω–µ—Ç. –¢–µ, –∫—Ç–æ –ø—Ä–µ–¥–ø–æ—á–∏—Ç–∞–µ—Ç –ø—Ä–µ–æ–¥–æ–ª–µ—Ç—å –ª—å–≤–∏–Ω—É—é –¥–æ–ª—é –ø—É—Ç–∏ –ø–æ –ñ–î, —Å–ª–µ–¥—É–µ—Ç –∏—Å–∫–∞—Ç—å –±–∏–ª–µ—Ç—ã –¥–æ –•–µ—Ä—Å–æ–Ω–∞ –∏ —Å–æ–≥–ª–∞—Å–æ–≤—ã–≤–∞—Ç—å –≤—Ä–µ–º—è –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏—è –∏ –ø—Ä–∏–±—ã—Ç–∏—è —Å —Ä–∞—Å–ø–∏—Å–∞–Ω–∏–µ–º –∞–≤—Ç–æ–±—É—Å–∞ –Ω–∞ –°–∫–∞–¥–æ–≤—Å–∫. –¢–µ–º, –∫—Ç–æ –ø—É—Ç–µ—à–µ—Å—Ç–≤—É–µ—Ç –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–º , —Å–ª–µ–¥—É–µ—Ç –≤–∑—è—Ç—å –∫—É—Ä—Å –Ω–∞ –•–µ—Ä—Å–æ–Ω, –∞ –∑–∞—Ç–µ–º –ø—Ä–æ—Å–ª–µ–¥–æ–≤–∞—Ç—å —á–µ—Ä–µ–∑ –°–∞–≥–∏, –†–∞–¥–µ–Ω—Å–∫, –í–µ–ª–∏–∫–∏–µ –ö–æ–ø–∞–Ω–∏, –ë—Ä–∏–ª–µ–≤–∫—É –Ω–∞ –°–∫–∞–¥–æ–≤—Å–∫. –°–∫–∞–¥–æ–≤—Å–∫ –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –Ω–∞ –ø–æ–±–µ—Ä–µ–∂—å–µ –î–∂–∞—Ä—ã–ª–≥–∞—á—Å–∫–æ–≥–æ –∑–∞–ª–∏–≤–∞ –ß–µ—Ä–Ω–æ–≥–æ –º–æ—Ä—è.</p>
<p>–°–∞–º –ø–æ —Å–µ–±–µ –∑–∞–ª–∏–≤ –¥–æ–≤–æ–ª—å–Ω–æ –º–µ–ª–∫–∏–π, –ø–æ—ç—Ç–æ–º—É –ø—Ä–æ–≥—Ä–µ–≤–∞–µ—Ç—Å—è –±—ã—Å—Ç—Ä–æ. –í—Ö–æ–¥ –≤ –≤–æ–¥—É –Ω–∞—Å—Ç–æ–ª—å–∫–æ –ø–æ–ª–æ–≥–∏–π, —á—Ç–æ –¥–æ –≥–ª—É–±–∏–Ω—ã, –ø–æ–∑–≤–æ–ª—è—é—â–µ–π –ø–æ–ø–ª–∞–≤–∞—Ç—å –≤–∑—Ä–æ—Å–ª–æ–º—É —á–µ–ª–æ–≤–µ–∫—É, –Ω—É–∂–Ω–æ ¬´–±—Ä–µ—Å—Ç–∏¬ª –ø–æ—Ä—è–¥–∫–∞ –º–µ—Ç—Ä–æ–≤ , –∞ —Ç–æ –∏ –±–æ–ª—å—à–µ. –í –≤–æ–¥–µ –≤—Å—Ç—Ä–µ—á–∞—é—Ç—Å—è –º–µ–¥—É–∑—ã –∏ –ø—Ä–∏—Å—É—Ç—Å—Ç–≤—É–µ—Ç –¥–æ–≤–æ–ª—å–Ω–æ –º–Ω–æ–≥–æ –≤–æ–¥–æ—Ä–æ—Å–ª–µ–π , –∫–æ—Ç–æ—Ä—ã–µ –º–µ—Å—Ç–∞–º–∏ —Å–∫–∞–ø–ª–∏–≤–∞—é—Ç—Å—è –∏ –Ω–∞ –±–µ—Ä–µ–≥—É. –ü—Ä–∏–º–µ—Ä–Ω–æ —Å —Å–µ—Ä–µ–¥–∏–Ω—ã –∞–≤–≥—É—Å—Ç–∞ –Ω–∞—á–∏–Ω–∞–µ—Ç—Å—è –ø—Ä–æ—Ü–µ—Å—Å —Ü–≤–µ—Ç–µ–Ω–∏—è –≤–æ–¥—ã , –∏–∑-–∑–∞ —á–µ–≥–æ –æ–Ω–∞ –ø—Ä–∏–æ–±—Ä–µ—Ç–∞–µ—Ç –∑–µ–ª–µ–Ω—ã–π –æ—Ç—Ç–µ–Ω–æ–∫, —Ä–µ–∑–∫–∏–π –∑–∞–ø–∞—Ö –∏ –∫—É–ø–∞–Ω–∏–µ —Å—Ç–∞–Ω–æ–≤–∏—Ç—å—Å—è –ø—Ä–∞–∫—Ç–∏—á–µ—Å–∫–∏ –Ω–µ–≤–æ–∑–º–æ–∂–Ω—ã–º.</p>
